import React from 'react';
import { Container } from 'react-bootstrap'
import Footer from './components/Footer';
import Header from './components/Header';
import HomeScreen from './components/screens/HomeScreen'

const App = () => {
  return (
    <>
     <Header/>
     <main className="py-3">
       <Container>
        <HomeScreen/>
       </Container>
     </main>
     <Footer/>
    </>
  );
}

export default App;
